import './Footer.css';
import logo from '../Assets/Logo.svg'
import {Link} from "react-router-dom";

const Footer = () => {
    return (
        <div className='footer'>
            <div className="footer-logo">
                <img src={logo} alt="Footer logo"/>
            </div>
            <ul className='footer-links'>
                <li>
                    <Link className={menu === 'products' ? 'nav-link current-page' : 'nav-link'}
                          to={'/'}>Products</Link>
                </li>
                <li>
                    <Link className={menu === 'search' ? 'nav-link current-page' : 'nav-link'}
                          to={'/search'}>Search</Link>
                </li>
                <li>
                    <Link className={menu === 'cart' ? 'nav-link current-page' : 'nav-link'} to={'/cart'}>Cart</Link>
                    <div className="nav-cart-count">0</div>
                </li>
            </ul>
        </div>
    )
}

export default Footer;
